import React from "react";
import PostComp from "../PostComp/PostComp";
import "./Horizon.css";

function Horizon() {
  return (
    <div class="outer-wrapper">
      <div class="wrapper">
        <div class="slide one">
          <PostComp />
        </div>
        <div class="slide two">
          <PostComp />
        </div>
        <div class="slide three">
          <PostComp />
        </div>
        <div class="slide four">
          <PostComp />
        </div>
      </div>
    </div>
  );
}

export default Horizon;
